import React, { useState } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Button,
  Box,
  Grid
} from '@mui/material';

function PriceModal({ open, onClose, onSubmit, product }) {
  const [step, setStep] = useState('price'); // 'price' or 'description'
  const [price, setPrice] = useState('');
  const [description, setDescription] = useState('');
  const [displayValue, setDisplayValue] = useState('0');

  const handleNumberClick = (num) => {
    if (displayValue === '0') {
      setDisplayValue(num.toString());
    } else {
      setDisplayValue(displayValue + num);
    }
    setPrice(parseFloat(displayValue + num) / 100);
  };

  const handleDecimalPoint = () => {
    if (!displayValue.includes('.')) {
      setDisplayValue(displayValue + '.');
    }
  };

  const handleClear = () => {
    setDisplayValue('0');
    setPrice('');
  };

  const handleNextStep = () => {
    setStep('description');
  };

  const handleSubmit = () => {
    onSubmit({
      price,
      description,
      product
    });
    // Reset everything
    setPrice('');
    setDescription('');
    setDisplayValue('0');
    setStep('price');
  };

  const handleClose = () => {
    // Reset everything on close
    setPrice('');
    setDescription('');
    setDisplayValue('0');
    setStep('price');
    onClose();
  };

  return (
    <Dialog open={open} onClose={handleClose} maxWidth="sm" fullWidth>
      <DialogTitle>
        {step === 'price' ? 'Set Price' : 'Add Description'} for {product?.Product}
      </DialogTitle>
      <DialogContent>
        {step === 'price' ? (
          <Box sx={{ p: 2 }}>
            <Box 
              sx={{ 
                mb: 2, 
                p: 2, 
                bgcolor: '#f5f5f5', 
                borderRadius: 1,
                textAlign: 'right',
                fontSize: '24px'
              }}
            >
              â‚¬{displayValue}
            </Box>
            <Grid container spacing={1}>
              {[7, 8, 9, 4, 5, 6, 1, 2, 3].map((num) => (
                <Grid item xs={4} key={num}>
                  <Button
                    fullWidth
                    variant="outlined"
                    onClick={() => handleNumberClick(num)}
                    sx={{ height: '60px', fontSize: '20px' }}
                  >
                    {num}
                  </Button>
                </Grid>
              ))}
              <Grid item xs={4}>
                <Button
                  fullWidth
                  variant="outlined"
                  onClick={handleClear}
                  sx={{ height: '60px' }}
                >
                  C
                </Button>
              </Grid>
              <Grid item xs={4}>
                <Button
                  fullWidth
                  variant="outlined"
                  onClick={() => handleNumberClick(0)}
                  sx={{ height: '60px', fontSize: '20px' }}
                >
                  0
                </Button>
              </Grid>
              <Grid item xs={4}>
                <Button
                  fullWidth
                  variant="outlined"
                  onClick={handleDecimalPoint}
                  sx={{ height: '60px', fontSize: '20px' }}
                >
                  .
                </Button>
              </Grid>
            </Grid>
          </Box>
        ) : (
          <TextField
            autoFocus
            fullWidth
            label="Description (model, details, etc.)"
            multiline
            rows={3}
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            placeholder="e.g., iPhone 14 Pro Max 256GB"
            sx={{ mt: 2 }}
          />
        )}
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose}>Cancel</Button>
        {step === 'price' ? (
          <Button 
            onClick={handleNextStep}
            disabled={!price}
            variant="contained"
          >
            Next
          </Button>
        ) : (
          <Button 
            onClick={handleSubmit}
            disabled={!description}
            variant="contained"
          >
            Add to Cart
          </Button>
        )}
      </DialogActions>
    </Dialog>
  );
}

export default PriceModal;
